import React,  { useState } from 'react';
//import { MDBTable, MDBTableHead, MDBTableBody } from 'mdb-react-ui-kit';

const handleSubmit = event => {
    event.preventDefault();    

}
function getSettings(){

    const [area, setArea] = useState("");
    const [segmentation, setSegmentation] = useState("");
    const [identification, setIdentification] = useState("");
    const [clustering, setClustering] = useState("");
    const [thresholding, setThresholding] = useState("");
    const [homoInteractions, setHomoInteractions] = useState("");
    const [heteroInteractions, sethomoInteractions] = useState("");



    console.log("==================================0")
    return(
    <div>

    <div id="settingsPage">

      <form  onSubmit={handleSubmit}>
        <p>Select the processes to run:</p>

            <div class="checkbox">    
                  <p>Area measurements: </p>
                  <input type = "checkbox" name="sample" onChange={(e)=>setArea(e.target.value)}/>                

            </div>
            <div class="checkbox">    

                  <p>Image segmentation: </p>
                  <input type = "checkbox" name="color" onChange={(e)=>setSegmentation(e.target.value)}/>
            </div>
            <div class="checkbox">    

                  <p>Cell type identification: </p>

                  <input type = "checkbox" name="comparison" onChange={(e)=>setIdentification(e.target.value)}/>


            </div>
            <div class="checkbox">    

            <p>Cell clustering: </p>

            <input type = "checkbox" name="comparison" onChange={(e)=>setIdentification(e.target.value)}/>


            </div>
            <div class="checkbox">    

            <p>Cell thresholding: </p>

            <input type = "checkbox" name="comparison" onChange={(e)=>setIdentification(e.target.value)}/>


            </div>
            <div class="checkbox">    

            <p>Homotypic interactions: </p>

            <input type = "checkbox" name="comparison" onChange={(e)=>setIdentification(e.target.value)}/>


            </div>
            <div class="checkbox">    

            <p>Heterotypic interactions: </p>

            <input type = "checkbox" name="comparison" onChange={(e)=>setIdentification(e.target.value)}/>


            </div>

            <div class="checkbox">    

            <p>Permuted interactions: </p>

            <input type = "checkbox" name="comparison" onChange={(e)=>setIdentification(e.target.value)}/>


            </div>

       </form>
    </div>
    </div>

    )
}
export default getSettings;
